from typing import List
from collections import defaultdict

class Solution:
    def rootCount(self, edges: List[List[int]], guesses: List[List[int]], k: int) -> int:
        # Build the graph
        graph = defaultdict(list)
        for u, v in edges:
            graph[u].append(v)
            graph[v].append(u)

        # Store guesses in a set for O(1) lookup
        guess_set = set((u, v) for u, v in guesses)

        # DFS to count correct guesses assuming root is 0
        def dfs(node, parent):
            count = 0
            for neighbor in graph[node]:
                if neighbor == parent:
                    continue
                if (node, neighbor) in guess_set:
                    count += 1
                count += dfs(neighbor, node)
            return count

        # Initial count of correct guesses with root 0
        correct_guesses_from_0 = dfs(0, -1)

        # DFS to re-root the tree and count correct guesses
        def re_root_dfs(node, parent, current_count):
            nonlocal result
            if current_count >= k:
                result += 1

            for neighbor in graph[node]:
                if neighbor == parent:
                    continue

                # Try making neighbor the new root
                if (node, neighbor) in guess_set:
                    new_count = current_count - 1
                else:
                    new_count = current_count

                if (neighbor, node) in guess_set:
                    new_count += 1

                re_root_dfs(neighbor, node, new_count)

        result = 0
        re_root_dfs(0, -1, correct_guesses_from_0)

        return result
```

This solution uses two DFS traversals of the tree. The first DFS (`dfs`) calculates the number of correct guesses if node 0 is the root. The second DFS (`re_root_dfs`) re-roots the tree at each node and recalculates the number of correct guesses, updating the result count if the number of correct guesses is at least `k`. The use of a set for guesses allows for efficient lookup during the DFS traversals.

